import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link, Routes } from 'react-router-dom';
import Home from './components/Home';
import LoginPage from './components/LoginPage';
import RegisterPage from './components/RegisterPage';
import AdminPanel from './components/AdminPanel';
import OpenComplaints from './components/OpenComplaints';
import SolvedComplaints from './components/SolvedComplaints';
import UserComplaints from './components/UserComplaints';
import CreateComplaint from './components/CreateComplaint';

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Ana Sayfa</Link>
            </li>
            <li>
              <Link to="/register">Kayıt Ol</Link>
            </li>
            <li>
              <Link to="/admin">Admin Paneli</Link>
            </li>
            <li>
              <Link to="/complaints/open">Açık Arızalar</Link>
            </li>
            <li>
              <Link to="/complaints/solved">Çözümlenmiş Arızalar</Link>
            </li>
            <li>
              <Link to="/complaints/user">Kullanıcı Arızaları</Link>
            </li>
            <li>
              <Link to="/complaint/create">Arıza Oluştur</Link>
            </li>
          </ul>
        </nav>
        <hr />
        <Routes>
          <Route exact path="/" component={Home} />
          <Route path="/login" component={LoginPage} />
          <Route path="/register" component={RegisterPage} />
          <Route path="/admin" component={AdminPanel} />
          <Route path="/complaints/open" component={OpenComplaints} />
          <Route path="/complaints/solved" component={SolvedComplaints} />
          <Route path="/complaints/user" component={UserComplaints} />
          <Route path="/complaint/create" component={CreateComplaint} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
